import React from 'react';
import s from './Header.module.css'
import logo from '../../img/logo.png'

const Header = () => {
    return (
        <div className={s.header}>
            <img src={logo} alt="" />

            <ul className={s.navbarList}>
                <li>Модуль 1 - Заняття 1 - Змінні та типи</li>

            </ul>

        </div>
    );
};
export default Header
